column8:
ラッピング希望商品とともに、こちらのページ「ギフトラッピングチケット」をギフト梱包数の個数だけショッピングカートにお入れください。<br>
<br>
商品一点につき、税込108円となっております。<br>
<br>

複数の商品をまとめてのラッピング包装は致しかねます。予めご了承くださいませ。
<br>
<br>

複数商品を注文頂いた際にギフトラッピングチケットと数量が異なる場合
、<br>

備考欄にラッピング希望の商品を事前にご連絡くださいませ。<br>
<br>


備考欄に記載がない場合は、商品の確認の為ご連絡させて頂く場合がございます。<br>
<br>
<b>※ラッピングのみのご購入はできません。</b><br>
<br>


<font color="#FF3300"><b>【※ギフト包装ご利用の際の注意点※】</b><br><br>


・ラッピングの種類は【男性用】【女性用】のご指定のみとなります。<br>

包装紙もしくはラッピング袋の色、柄などのご指定、ご要望は承っておりません。<br>

写真のギフト包装材はイメージとなります。商品のサイズ・形状によって包装紙等が変わります。予めご了承ください。<br>
<br>
・商品の形状・性質によっては、ギフト対応不可となる場合がございます。
<br>
その場合ご注文確定後に弊社からラッピングお断りのメールをお送りさせて頂き、ご注文の金額修正（ラッピング代を引かせていただきます）を実行させていただきます。予めご了承くださいませ。<br>

<br>

・ラッピング商品をお届けする際、贈り物を考慮して納品書は同封致しておりません。<br>
納品書をご希望のお客様は、ラッピングチケットをカートに入れる前の選択肢にて<br>
「納品書を希望する」をお選び下さい。<br>
お届け先がご注文者様と同じ場合、ラッピング商品に納品書を同封して発送させて頂きます。<br>
<br>
<br>

・各ブランド専用の化粧箱やリボン、専用手提袋等はご用意出来ません。
<br><br>


・メッセージカード、のしがけ等のサービスはお受けしておりません。
<br>
<br>



間違えてご注文頂いた場合など、お客様都合の場合、弊社では返品返金を受け付けておりません。<br><br>


ラッピングセットのみのご注文はお受けしてませんのでご了承くださいませ。</font><br>
<br>



・現物に近い色が出る様に写真を撮っておりますが、多少色が濃く見えたり、薄く見えたりする場合がございます。<br><br>


<br>   <img src="http://image.rakuten.co.jp/auc-kazzu/cabinet/01565735/01849602/imgrc0067427713.jpg"><br>　<br>
<br>
<p><font size="-1">
【プレゼントにおすすめ！！】（11/22は いい夫婦の日 12/25は クリスマス ）<br>
当店では誕生日プレゼントや記念日のギフトなどの贈り物に人気の財布やバッグ、キーケースや名刺ケースなどの小物を多数取り扱っております。楽天ランキング１位の人気ブランドも数多く取り扱っておりますので是非ご覧くださいませ。
ギフトラッピングは女性用と男性用の２種類ご用意しております。<br>
※一部大きいサイズの商品（キャリーケースやビジネスバッグ、ボストンバッグ等の大きい鞄類）などはラッピング対象外となる場合がございます。<br>
↓ギフトラッピングのご注文はこちらから↓</font><br>
<img src="http://image.rakuten.co.jp/clelia/cabinet/03848340/imgrc0065231460.jpg" alt="誕生日や記念日のプレゼントなどに！ギフトラッピングはこちらからご注文ください">
</p><br>
